/*Table structure for table `payment_imports` */

DROP TABLE IF EXISTS `payment_imports`;

CREATE TABLE `payment_imports` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `payment_imports_id` int(10) unsigned DEFAULT NULL,
  `bank_accounts_id` int(10) unsigned NOT NULL,
  `payment_date` date NOT NULL,
  `amount` decimal(12,2) NOT NULL,
  `currency` varchar(3) NOT NULL DEFAULT 'CZK',
  `counterpart_account` varchar(100) DEFAULT NULL,
  `note` text DEFAULT NULL,
  `fio_transaction_id` varchar(50) DEFAULT NULL,
  `contracts_id` int(10) unsigned DEFAULT NULL,
  `period_year` smallint(5) unsigned DEFAULT NULL,
  `period_month` tinyint(3) unsigned DEFAULT NULL,
  `period_year_to` smallint(5) unsigned DEFAULT NULL,
  `period_month_to` tinyint(3) unsigned DEFAULT NULL,
  `payment_type` varchar(20) DEFAULT NULL,
  `payment_request_id` int(10) unsigned DEFAULT NULL COMMENT 'entity_id požadavku na platbu (pro úhradu energie, doplatku…)',
  `created_at` datetime NOT NULL DEFAULT current_timestamp(),
  `valid_from` datetime NOT NULL DEFAULT current_timestamp(),
  `valid_to` datetime DEFAULT NULL,
  `valid_user_from` int(10) unsigned DEFAULT NULL,
  `valid_user_to` int(10) unsigned DEFAULT NULL,
  `approved_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_bank_fio` (`bank_accounts_id`,`fio_transaction_id`),
  KEY `idx_bank_created` (`bank_accounts_id`,`created_at`),
  KEY `idx_payment_imports_id` (`payment_imports_id`,`valid_to`),
  KEY `idx_pi_v` (`valid_to`),
  KEY `idx_pi_approved` (`approved_at`)
) ENGINE=InnoDB AUTO_INCREMENT=153 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_czech_ci;

